      $("document").ready(function ($) {
        function setLogoColor(color) {
          $("#imgLogo").attr(
            "src",
            "https://fga.blob.core.windows.net/fga-files/logo_com_texto_" + color + ".png"
          );
        }

        function handleLogoColor() {
          if ($(window).scrollTop() === 0) {
            setLogoColor("preto");
          } else {
            setLogoColor("branco");
          }
        }

        $(window).on("resize", function () {
          if ($(window).width() <= 1199) {
            setLogoColor("branco");
            $(window).off("scroll", handleLogoColor);
          } else {
            setLogoColor("preto");
            $(window).on("scroll", handleLogoColor);
          }
        });

        $(window).trigger("resize");
      });
